import styles from './navbar.module.css';
import Logo from '../../assets/logo.png';

export default function Header() {
    return (
        <nav className={styles.navbar}>
            <img src={Logo} alt='Logomarca da Empresa'/>
            <div className={styles.list}>
                <ul className={styles.list_ul}>
                    <li className={styles.list_ul_li}><a href="">Home</a></li>
                    <li className={styles.list_ul_li}><a href="">Financeiro</a></li>
                    <li className={styles.list_ul_li}><a href="">Estoque</a></li>
                </ul>
                <div>
                    <input className={styles.consulta} type="text" name="consulta" id="conulta" placeholder='Consulta...' />
                </div>
                
            </div>
        </nav>
    )
}
